def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    """Even more complex logic for assigning priorities to bins."""
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        ratio = item / bins[i]

        if ratio < 0.25:
            priorities[i] = 2.5 * ratio + 0.3
        elif 0.25 <= ratio < 0.4:
            priorities[i] = 2.2 * ratio + 0.5
        elif 0.4 <= ratio < 0.6:
            priorities[i] = 2 * ratio + 0.7
        elif 0.6 <= ratio < 0.8:
            priorities[i] = 1.8 * ratio + 0.9
        elif 0.8 <= ratio < 1:
            priorities[i] = 1.6 * ratio + 1.1
        elif 1 <= ratio < 1.2:
            priorities[i] = 1.4 * ratio + 1.3
        elif 1.2 <= ratio < 1.4:
            priorities[i] = 1.2 * ratio + 1.5
        elif 1.4 <= ratio < 1.6:
            priorities[i] = 1 * ratio + 1.7
        elif 1.6 <= ratio < 1.8:
            priorities[i] = 0.8 * ratio + 1.9
        else:
            priorities[i] = 0.6 * ratio + 2

    return priorities
